import { getConnection }  from '../database/database';
import PDFDocument  from "pdfkit-table";

const tableName = 'users';
const tableNameAssistent = 'assistent';

const imgBase64 = 'data:image/png;base64,'

const buildPdf = (dataAssitent, endPdf, dataTable, startDate, endDate) => {
    const doc = new PDFDocument({ margin: 30, size: 'A4' });

    doc.on('data', dataAssitent);
    doc.on('end', endPdf);

    const footerText = '+58 424-685-6852          +58 261-887-4458           laboratorioclinicohyf@gmail.com             Validar en hyflabconsul.com';

    const docWidth = 600;
    const imageWidth = 300;
    const xPosition = (docWidth - imageWidth) / 2;
    doc.image(imgBase64, xPosition, 15, { width: imageWidth });
    doc.moveDown(4); 

    doc.fontSize(18).text('Asistencia de Empleados', { align: 'center', });
    doc.moveDown(0.5); 

    doc.fontSize(12).text(`Desde: ${parseDateString(String(startDate))}`, { align: 'left' });
    doc.fontSize(12).text(`Hasta: ${parseDateString(String(endDate))}`, { align: 'right' });
    doc.moveDown(0.5);

    const table = {
        // title: 'Registros de la base de datos',
        headers: [
            // { label: 'ID', property: 'Id', width: 20 },
            { label: 'Nombre completo', property: 'NameFull', width: 250 },
            { label: 'Cedula', property: 'Identify', width: 80 },
            { label: 'Fecha de inicio', property: 'DateStart', width: 100 },
            { label: 'Fecha de fin', property: 'DateEnd', width: 100 },
        ],
        datas: dataTable.map(item => ({
            // Id: item.Id,
            NameFull: item.NameFull,
            Identify: item.Identify,
            DateStart: parseDateString(String(item.DateStart), true),
            DateEnd: parseDateString(String(item.DateEnd), true),
        })),
    };
    doc.table(table, { width: 500 });

    doc.text(footerText, { align: 'center' });

    doc.end();
}

const getAssistent = async (req, res) =>{
    const queryGet =`SELECT assistent.Id, users.NameFull, users.Identify, assistent.DateStart, assistent.DateEnd FROM ${tableNameAssistent} join ${tableName} on assistent.IdUser = users.Id`;
    try {
        const { DateStart, DateEnd } = req.body;
        const parseEnd = new Date(DateEnd);
        parseEnd.setDate(parseEnd.getDate() + 1);
        const connection = await getConnection();
        const result = await connection.query(`${queryGet} WHERE DateStart BETWEEN '${DateStart}' and '${parseEnd.toISOString()}'`);

        try{
            if(result && result.length > 0){
                const stream = res.writeHead(200, {
                    "Content-Type": "application/pdf",
                    "Content-Disposition": "attachment; filename=assistencia.pdf"
                });
                buildPdf((data) => {
                    stream.write(data)
                }, 
                () => stream.end(),
                result,
                DateStart,
                DateEnd
                );
            }else{
                res.json({message: 'Ha ocurrido un error.', success: false})
            }
        }
        catch(err) {
            console.log(err);
        }

        }
    catch (err) {
        res.status(500)
        res.send(err.message)
    }
}

function parseDateString(inputString, datetime) {
    const date = new Date(inputString);
    const day = date.getDate();
    const month = date.getMonth() + 1;
    const year = date.getFullYear();
    const hours = date.getHours();
    const minutes = date.getMinutes();
    const formattedDate = `${day}/${month}/${year}`;
    const formattedTime = `${hours % 12}:${minutes < 10 ? '0' : ''}${minutes}${hours >= 12 ? 'PM' : 'AM'}`;
    const result = datetime ? `${formattedDate} - ${formattedTime}` : formattedDate;
    return result;
}

export const methods = {
    getAssistent,
};